import { MyDataService } from '../../services/my-data.service';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-genre-ranking',
  templateUrl: './genre-ranking.component.html',
  styleUrls: ['./genre-ranking.component.css']
})
export class GenreRankingComponent implements OnInit {
  myData$: any;
  constructor (private MyDataService: MyDataService) {}

  ngOnInit(): void{
    this.myData$ = this.MyDataService.getData();
  }
}

async function getGenres()
{
  fetch('https://localhost:7110/api/Genres')
  .then(response => response.json())
  .then(data => {
    console.log(data); // Use the response data as needed
  })
  .catch(error => {
    console.error('Error:', error);
  });

}

async function getAppRanking()
{
  fetch('https://localhost:7110/api/appRanking')
  .then(response => response.json())
  .then(data => {
    console.log(data); // Use the response data as needed
  })
  .catch(error => {
    console.error('Error:', error);
  });

}

async function getAppDetails()
{
  fetch('https://localhost:7110/api/appDetails')
  .then(response => response.json())
  .then(data => {
    console.log(data); // Use the response data as needed
  })
  .catch(error => {
    console.error('Error:', error);
  });

}


getGenres();
